import React, { Component } from 'react';
import { withRouter } from 'react-router-dom';
import fire from '../../config/firebase';
import Logo from '../../assets/logo/hi.png';
import Button from '@material-ui/core/Button';
import ArrowBack  from '@material-ui/icons/ArrowBack';
import ExitToApp from '@material-ui/icons/ExitToApp';
import Fab from '@material-ui/core/Fab';
import './header.css';


class Header extends Component{
    constructor(props){
        super(props)
        this.setState={}

       this.logout = () => {
            fire.auth().signOut()
            .then(() => this.props.history.push('/login'))
            .catch( error => error );
        }

        this.back = () => {
          this.props.history.goBack();
        }
    }

    render(){
        return(
            <div style={{ display: 'flex', alignItems: 'center' }}>
            <Fab onClick={this.back} color="primary" aria-label="add">
            <ArrowBack />
            </Fab>

            <div style={{ display: 'flex', alignItems: 'center' }}>
            <p className='title'>Burger</p>
            <p className='title'>Queen</p>
            <img style={{maxWidth: '200px'}} src={Logo} alt='Logo' />
            </div>

            <Button onClick={this.logout}><ExitToApp /></Button>
            </div>
        )
    }
}

export default withRouter(Header)
